import React from 'react';
import {Route, Switch} from 'react-router-dom';
import Llamas from '../Llamas/Llamas';
import AboutPratik from '../Pratik/AboutPratik'

const Routes = () => {
    return (

        <section>
            <Switch>
                <Route exact path='llamas' />
            </Switch>
        </section>
    );

};

export default Routes;
